import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import Hypertension from '../hypertension/Hypertension';
import KidneyDisease from '../kidneyDisease/KidneyDisease';
import MenuContainer from "./menu";

function Index() {
  return <h2>Home</h2>;
}

function AppRouter() {
  return (
    <Router>
      <div>
        {/* <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/about/">Hypertension</Link>
            </li>
            <li>
              <Link to="/users/">Kidney Disease</Link>
            </li>
          </ul>
        </nav> */}

        <Route path="/" exact component={MenuContainer} />
        <Route path="/about/" component={Hypertension} />
        <Route path="/users/" component={KidneyDisease} />
      </div>
    </Router>
  );
}

export default AppRouter;
